{"cells":[{"source":"<a href=\"https://www.kaggle.com/saurabh008978/bell-beat-case-study-data-analysis?scriptVersionId=88536979\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"aa7a8bde","metadata":{"papermill":{"duration":0.084056,"end_time":"2022-02-23T07:31:13.840209","exception":false,"start_time":"2022-02-23T07:31:13.756153","status":"completed"},"tags":[]},"source":[" Summary\n"," Bellabeat is a high-tech company that creates smart health products. Women all over the world are informed and inspired by beautifully designed technology. Bellabeat has been able to empower their users with knowledge about their own health and habits by collecting data on activity, sleep, stress, and reproductive health."]},{"cell_type":"markdown","id":"d141d8c6","metadata":{"papermill":{"duration":0.080209,"end_time":"2022-02-23T07:31:14.000377","exception":false,"start_time":"2022-02-23T07:31:13.920168","status":"completed"},"tags":[]},"source":["Business Task\n","The project's goal is to analyse smart device usage data in order to learn how consumers use non-Bellabeat smart devices. Using this data, we will then prepare recommendations for how these trends can influence Bellabeat's marketing strategy. The analysis will be guided by the following questions:\n","\n","What are some of the current trends in smart device usage?\n","How might these trends affect Bellabeat customers?\n","How might these trends affect Bellabeat's marketing strategy?\n","Key stakeholders are Marketing team and Urška Sršen - Bellabeat cofounder and Chief Creative Officer."]},{"cell_type":"markdown","id":"b2e3f5c1","metadata":{"papermill":{"duration":0.079254,"end_time":"2022-02-23T07:31:14.159033","exception":false,"start_time":"2022-02-23T07:31:14.079779","status":"completed"},"tags":[]},"source":["Data set used\n","This analysis will make use of the FitBit Fitness Tracker dataset (CC0: Public Domain). This Kaggle data set contains thirty fitbit users' personal fitness trackers. Thirty eligible Fitbit users agreed to have their personal tracker data submitted, including minute-level output for physical activity, heart rate, and sleep monitoring. It contains data on daily activity, steps, and heart rate that can be used to investigate users' habits."]},{"cell_type":"markdown","id":"96f538ff","metadata":{"papermill":{"duration":0.079086,"end_time":"2022-02-23T07:31:14.31836","exception":false,"start_time":"2022-02-23T07:31:14.239274","status":"completed"},"tags":[]},"source":["Credibility and Integrity of Data: No Metadata Provided: Location, lifestyle, weather, temperature, humidity, and so on would provide a richer context for the data obtained.\n","Demographic Information Is Missing: There is a lack of demographic information in the data. Gender and age were not identified as demographics. Because Bellabeat manufactures products for women, this type of information is critical for future marketing planning.\n","\n","Size constraint: Only 30 users agreed to submit personal tracker data. Another data bias may be caused by such a factor.\n","\n","Data Collection Period: In order to provide high-level recommendations, 31 days of data must be collected. Seasonal trends have a significant impact on user activity and lifestyle choices. Exercising habits of users, for example, differ between summer and winter."]},{"cell_type":"markdown","id":"9ab6937b","metadata":{"papermill":{"duration":0.078333,"end_time":"2022-02-23T07:31:14.475362","exception":false,"start_time":"2022-02-23T07:31:14.397029","status":"completed"},"tags":[]},"source":["Installing libraries to use functions in our analysis"]},{"cell_type":"code","execution_count":1,"id":"aa1dccc2","metadata":{"execution":{"iopub.execute_input":"2022-02-23T07:31:14.642254Z","iopub.status.busy":"2022-02-23T07:31:14.639707Z","iopub