s a small number of people and lacks demographic information, it is prone to bias.\n","\n","Tracking of activities\n","We classified users based on the number of steps they took per day. The average user walked more than 7500 steps, and 8/33 users engaged in sedentary activity (24 percent ). Devices could send notifications when the target is not met to discourage users from leading sedentary lifestyles. A pie chart could be used to show how many steps are missed to reach each user's individual goal.\n","\n","Sleeping hours\n","Sleeping hours analysis revealed that the average user sleeps for less than 8 hours - roughly 7 hours. In addition, he sleeps for approximately 7.6 hours per day. According to our findings, users spend 36 minutes attempting to sleep. Our customers' smart devices could notify a user after 15 minutes in bed about how to improve their sleep through breathing exercises, sleeping music, and other techniques."]},{"cell_type":"markdown","id":"66b0f1cc","metadata":{"papermill":{"duration":0.204307,"end_time":"2022-02-23T07:31:29.409031","exception":false,"start_time":"2022-02-23T07:31:29.204724","status":"completed"},"tags":[]},"source":["\n","All credit goes to the authors who have completed their own capstone projects, which are listed below. Through their work, I gained clarity and direction for my very first attempt at R programming:\n","https://www.kaggle.com/rejoseph/bellabeat-case-study-r\n"]},{"cell_type":"markdown","id":"0a8cdfcc","metadata":{"papermill":{"duration":0.218684,"end_time":"2022-02-23T07:31:29.887101","exception":false,"start_time":"2022-02-23T07:31:29.668417","status":"completed"},"tags":[]},"source":[]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":19.879414,"end_time":"2022-02-23T07:31:30.193509","environment_var